---
# Populate symbol_lib_id / footprint_lib_id for parts missing from JLCPCB library.
# Use "DNP" to mark parts that should be skipped in schematic generation.
#
# Example:
# CXXXXXX:
#   symbol_lib_id: "MyLib:CustomSymbol"
#   footprint_lib_id: "MyLib:CustomFootprint"

# External/DNP components - not placed on PCB
NOT_FOUND:
  symbol_lib_id: "DNP"
  footprint_lib_id: "DNP"
  note: "External components (antennas, wires) - not in JLCPCB library"
